    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT - - ( col2 ) * + col0 * + + col1 + - col1 * 32 + col0 IS NULL;
  - name: tab1

outputs:
  - name: q7586.out
    data: |
      51	14	96
      85	5	59
      91	47	68
